import React, { useState, useEffect } from 'react';

export default function Character({ setCharacter }) {
  const images = require.context('../../public/character_images', true);
  const characters = ['arya_stark','jon_snow','daenerys_targaryen','tyrion_lannister','cersei_lannister','lord_varys','oberyn_martell','petyr_baelish']

  return (
    <div className='flex flex-wrap justify-center justify-around'>
      {characters.map((char) => {
        const sprite = images(`./${char}.png`);
        return (
          <li key={char} className='list-none cursor-pointer' onClick={(char) => setCharacter(char)}>
            <img src={sprite} id={char} className='object-cover h-56  hover:h-64' />
          </li>
        )
      })}
    </div>
  )
}
